import {Component, Input} from '@angular/core';
import {User} from "../../model/User";
import {ActivatedRoute} from "@angular/router";
import {UserService} from "../../services/user.service";
import {Fonction} from "../../model/Fonction";

@Component({
  selector: 'app-user-details',
  templateUrl: './user-details.component.html',
  styleUrls: ['./user-details.component.css']
})
export class UserDetailsComponent {

  user!: User
  mode: String = "Edit"
  fonctions = Object.values(Fonction)

  constructor(
    private userService: UserService,
    private route: ActivatedRoute ) {
    //this.user=history.state.user;
    const id_user: Number = Number(this.route.snapshot.paramMap.get("id"))
    this.userService.getUserById(id_user).subscribe(user => this.user = user)
    for (let fonction of this.fonctions) {
      console.log(fonction)
    }
  }

  changeMode() {
    if (this.mode==="Edit") {
      this.mode = "Display"
    } else {
      this.mode = "Edit"
    }
  }

  updateUser() {
    console.log("update")
    this.userService.update(this.user).subscribe(()=>this.changeMode());
  }

}
<button type="button" (click)="changeMode()">{{mode}}</button>
<ng-container *ngIf="mode==='Edit' then display else edit"></ng-container>
<ng-template #display>
  <p>Id : {{user.id}}</p>
  <p>Nom : {{user.nom}}</p>
  <p>Fonction : {{user.fonction}}</p>
  <div class="commentaires">Commentaires :
    <a class="commentaire"
       *ngFor="let comment of user.commentairesEcrits"
       href="{{comment.url}}">Commentaire {{comment.id}}</a>
  </div>
</ng-template>
<ng-template #edit>
  <form (ngSubmit)="updateUser()">
    <label for="id">Id : </label><input [(ngModel)]="user.id" id="id" name="id">
    <label for="nom">Nom :</label><input [(ngModel)]="user.nom" id="nom" name="nom">
    <label for="fonction">Fonction :</label><select [(ngModel)]="user.fonction" id="fonction" name="fonction">
      <option *ngFor="let fonction of fonctions">{{ fonction }}</option>
    </select>
    <button type="submit">Envoyer</button><button type="reset">Reset</button>
  </form>
</ng-template>
